import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';
import Home from './components/home';
import movie from './components/movie-vault';
import scare from './components/scare-level';


class App extends React.Component {
  render(){
    return (
      <div className="main">
        <Router>
          <div className="">
            <div className="">
              {/* shows logo */}
              <div>
                <img src="https://natran.com/wp-content/uploads/2019/10/pumpkin-2892303_1920.jpg" width="30" height="30" alt="black and white film strip with brand name"/>
              </div>
              <div>
                <p>Halloween Party</p>
              </div>
            </div>

            {/* displays the nav bar */}
            <div id="nav">
              {/* link id is what changes the components on the page */}
              <Link id="home" to="/">Home</Link> {' '}
              <Link id="other-links" to='/movie-vault' >Movie Vault</Link> {' '}
              <Link id="other-links" to='/scare-level'>Scare Level</Link> {' '}
            </div> 
          </div>
            <Switch>
              <Route exact path="/" component={Home}/>
              <Route path="/movie-vault" component={movie}/>
              <Route path="/scare-level" component={scare}/>
            </Switch>
        </Router>

        <h style={{color: "orange"}}>Hello World!</h>
       
      </div>
    );
  };
};




export default App;
